// Тематический блок на первую страницу
import React, { Component } from "react";
import { Container, Row, Col } from 'reactstrap';
import Block from "./Block"
import './mycss/my.css'

export default class BlockTheme extends Component {
    render() {
        var blocks = [];

        this.props.info.forEach(element => {
            // console.log(element.sectiontitle);
            // console.log(element.sections);
            blocks.push(<Block sections={element} key={Math.random()} />);
        }
        );

        return (
                    // {/* Заголовок розділу */}
                    // {/* <p className="block-name">    TITLE </p> */}
                    // {console.log("============== Start ==================")}
                    // {console.log(this.props.info)}
                    // {console.log("============== End ====================")}
                    // {console.log(blocks)}
                    {blocks}
        );
    }
}
